import {useState} from "react";

function Imc() {
    const [peso, setPeso] = useState();
    const [altura, setAltura] = useState();


    return (
        <>
        <form onSubmit={() => {
            result = ""
            result = peso/(altura * altura);

        }}>
            <label>Peso</label>
            <input onChange={(e) => {
                setPeso(e.target.value);
            }}/>
            <br/>
            <label>Altura</label>
            <input onChange={(e) => {
                setAltura(e.target.value);
            }}/>
            <br/>
            <input type='submit'/>
        </form>

        <p>Resultado: {result}</p>
        </>


    )
    
}

export default Imc;
